import{_ as e,c as i,o as t,a3 as s,af as o}from"./chunks/framework.rXM8bS_u.js";const m=JSON.parse('{"title":"Frequently Asked Questions","description":"","frontmatter":{},"headers":[],"relativePath":"en-US/joplin-vscode-plugin/faq.md","filePath":"en-US/joplin-vscode-plugin/faq.md"}'),n={name:"en-US/joplin-vscode-plugin/faq.md"},a=s(`<h1 id="frequently-asked-questions" tabindex="-1">Frequently Asked Questions <a class="header-anchor" href="#frequently-asked-questions" aria-label="Permalink to &quot;Frequently Asked Questions&quot;">​</a></h1><h2 id="why-develop-this-plugin" tabindex="-1">Why Develop This Plugin <a class="header-anchor" href="#why-develop-this-plugin" aria-label="Permalink to &quot;Why Develop This Plugin&quot;">​</a></h2><ol><li>As a professional editor, VSCode’s editing features vastly outperform those of note-taking tools. For instance, it has extensive shortcut support.</li><li>VSCode is not just an editor but boasts a massive ecosystem of plugins. It already supports markdown formatting, lint checks, PDF exports, and many other functions. We don’t need to reinvent the wheel, which might end up being a square one, within a note-taking tool.</li><li>Personally, I have been using VSCode to edit markdown documents and to store company-related documents with git + VSCode. Also, I’ve been using Joplin for personal notes, yet after a while, I found that I needed synchronization/search functionality between VSCode and Joplin.</li></ol><p>Thus, I developed this plugin for others with similar needs.</p><h2 id="error-message-joplin-s-token-port-is-set-incorrectly-unable-to-access-joplin-service" tabindex="-1">Error Message <strong>Joplin’s token/port is set incorrectly, unable to access Joplin service!</strong> <a class="header-anchor" href="#error-message-joplin-s-token-port-is-set-incorrectly-unable-to-access-joplin-service" aria-label="Permalink to &quot;Error Message **Joplin’s token/port is set incorrectly, unable to access Joplin service!**&quot;">​</a></h2><p>Please try executing the following command in CMD/Bash. If there are no issues, it should return <strong>JoplinClipperServer</strong>. Otherwise, consider filing an issue with Joplin.</p><div class="language-cmd vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang">cmd</span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;">curl http://</span><span style="--shiki-light:#005CC5;--shiki-dark:#79B8FF;">127.0.0.1</span><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;">:</span><span style="--shiki-light:#005CC5;--shiki-dark:#79B8FF;">41184</span><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;">/ping</span></span></code></pre></div><h2 id="how-to-list-joplin-notes-opened-in-vscode" tabindex="-1">How to List Joplin Notes Opened in VSCode <a class="header-anchor" href="#how-to-list-joplin-notes-opened-in-vscode" aria-label="Permalink to &quot;How to List Joplin Notes Opened in VSCode&quot;">​</a></h2><p>Though there isn&#39;t official support, you can use the shortcut <code>c+j c+o</code> to list the 20 most recently modified Joplin notes, achieving a similar effect.</p><blockquote><p>The main reason for the lack of formal support might be the functional overlap between the two. Additionally, VSCode’s list of recently opened files includes more than just the files currently open in the editor, encompassing even closed files.</p></blockquote><h2 id="unable-to-open-notes-from-the-sidebar" tabindex="-1">Unable to Open Notes from the Sidebar <a class="header-anchor" href="#unable-to-open-notes-from-the-sidebar" aria-label="Permalink to &quot;Unable to Open Notes from the Sidebar&quot;">​</a></h2><p>This issue could arise for several reasons:</p><ol><li><p>Check if you can open VSCode through the <strong>Toggle External Editing</strong> feature in Joplin.</p><ol><li>If it doesn’t open, inspect the text editor command in Joplin’s settings. Ensure a valid editor setting is applied. Refer to: <a href="https://github.com/laurent22/joplin/issues/5921#issuecomment-1002692774" target="_blank" rel="noreferrer">https://github.com/laurent22/joplin/issues/5921#issuecomment-1002692774</a></li><li>If the issue persists, file an <a href="https://github.com/laurent22/joplin/issues" target="_blank" rel="noreferrer">issue with Joplin</a>.</li></ol></li><li><p>Use version v1.4 or higher as it includes necessary <a href="https://discourse.joplinapp.org/t/9277/11" target="_blank" rel="noreferrer">action APIs</a> for functionalities like opening notes in VSCode based on noteId.</p></li><li><p>Ensure Joplin Desktop is installed on the current computer. This plugin does not support the CLI version as it lacks the aforementioned action APIs. Refer to: <a href="https://discourse.joplinapp.org/t/16735" target="_blank" rel="noreferrer">https://discourse.joplinapp.org/t/16735</a></p></li><li><p>Verify if the following command can execute correctly. If you still can&#39;t open notes in the editor, consider reaching out to @laurent22.</p><div class="language-sh vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang">sh</span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span style="--shiki-light:#6F42C1;--shiki-dark:#B392F0;">curl</span><span style="--shiki-light:#005CC5;--shiki-dark:#79B8FF;"> --location</span><span style="--shiki-light:#005CC5;--shiki-dark:#79B8FF;"> --request</span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;"> POST</span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;"> &#39;http://localhost:41184/services/externalEditWatcher?token=***&#39;</span><span style="--shiki-light:#005CC5;--shiki-dark:#79B8FF;"> \\</span></span>
<span class="line"><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;">--header </span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;">&#39;Content-Type: application/json&#39;</span><span style="--shiki-light:#005CC5;--shiki-dark:#79B8FF;"> \\</span></span>
<span class="line"><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;">--data-raw </span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;">&#39;{</span></span>
<span class="line"><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;"> &quot;action&quot;: &quot;openAndWatch&quot;,</span></span>
<span class="line"><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;"> &quot;noteId&quot;: &quot;257f6a9dacc1409580ee526d50ac4d49&quot;</span></span>
<span class="line"><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;">}&#39;</span></span></code></pre></div></li></ol><h2 id="unable-to-upload-clipboard-images-on-windows-10" tabindex="-1">Unable to Upload Clipboard Images on Windows 10 <a class="header-anchor" href="#unable-to-upload-clipboard-images-on-windows-10" aria-label="Permalink to &quot;Unable to Upload Clipboard Images on Windows 10&quot;">​</a></h2><p>This could be due to missing PowerShell. Check by typing PowerShell in CMD.</p><div class="language-sh vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang">sh</span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span style="--shiki-light:#6F42C1;--shiki-dark:#B392F0;">powershell</span></span></code></pre></div><p><img src="https://user-images.githubusercontent.com/24560368/115563663-5d855c00-a2ea-11eb-8b08-dfa7dd773601.png" alt="powershell"></p><p>If prompted with <code>spawn powershell ENOENT</code>, you need to install PowerShell. Refer to: <a href="https://docs.microsoft.com/en-us/powershell/scripting/install/installing-powershell-core-on-windows?view=powershell-7.1" target="_blank" rel="noreferrer">Installing PowerShell on Windows</a></p><h2 id="how-to-use-the-plugin-with-two-synchronized-vscode-configurations" tabindex="-1">How to Use the Plugin with Two Synchronized VSCode Configurations <a class="header-anchor" href="#how-to-use-the-plugin-with-two-synchronized-vscode-configurations" aria-label="Permalink to &quot;How to Use the Plugin with Two Synchronized VSCode Configurations&quot;">​</a></h2><p>By default, Joplin generates a random token for each computer. However, you can manually modify it. Usually, the configuration file is located at <em>~/.config/joplin-desktop/settings.json</em>. You just need to set the <code>api.token</code> to the same token.</p><p><img src="`+o+'" alt="manually-set-token-of-joplin"></p><blockquote><p>Reference: <a href="https://github.com/rxliuli/joplin-utils/issues/25" target="_blank" rel="noreferrer">https://github.com/rxliuli/joplin-utils/issues/25</a></p></blockquote><h2 id="markdown-preview-can-t-display-images" tabindex="-1">Markdown Preview Can&#39;t Display Images <a class="header-anchor" href="#markdown-preview-can-t-display-images" aria-label="Permalink to &quot;Markdown Preview Can&#39;t Display Images&quot;">​</a></h2><p>When you first use the Joplin VSCode plugin, you may encounter issues with images not displaying in the markdown preview. The preview might show a message stating <strong>Some content has been disabled in this document</strong>. This can be easily resolved.</p><ol><li>Enter the command <code>markdown.showPreviewSecuritySelector</code>.</li><li>Select <code>Allow insecure local content</code> from the list.</li></ol><blockquote><p><a href="https://code.visualstudio.com/docs/languages/markdown#_markdown-preview-security" target="_blank" rel="noreferrer">VSCode Markdown Documentation</a></p></blockquote><h2 id="incompatibility-with-markdown-preview-enhanced-plugin" tabindex="-1">Incompatibility with Markdown Preview Enhanced Plugin <a class="header-anchor" href="#incompatibility-with-markdown-preview-enhanced-plugin" aria-label="Permalink to &quot;Incompatibility with Markdown Preview Enhanced Plugin&quot;">​</a></h2><p>Since Markdown Preview Enhanced constructs its own webview page for rendering markdown files and disregards the <a href="https://code.visualstudio.com/api/extension-guides/markdown-extension" target="_blank" rel="noreferrer">markdown-it extension interface API</a> provided by VSCode, it’s currently incompatible. It is recommended to use <a href="https://marketplace.visualstudio.com/items?itemName=yzhang.markdown-all-in-one" target="_blank" rel="noreferrer">Markdown All in One</a> instead. Refer to: <a href="https://github.com/rxliuli/joplin-utils/issues/46" target="_blank" rel="noreferrer">https://github.com/rxliuli/joplin-utils/issues/46</a></p><h2 id="unable-to-paste-images-into-notes-on-linux" tabindex="-1">Unable to Paste Images into Notes on Linux <a class="header-anchor" href="#unable-to-paste-images-into-notes-on-linux" aria-label="Permalink to &quot;Unable to Paste Images into Notes on Linux&quot;">​</a></h2><p>Please install <a href="https://github.com/astrand/xclip" target="_blank" rel="noreferrer">xclip</a> and <a href="https://github.com/bugaevc/wl-clipboard" target="_blank" rel="noreferrer">wl-clipboard</a> first.</p>',30),l=[a];function r(h,p,d,c,u,g){return t(),i("div",null,l)}const f=e(n,[["render",r]]);export{m as __pageData,f as default};
